import './App.css';
import React, {useState, useEffect} from 'react';

function App() {
  const [num, setNum] = useState(0);
  const [numB, setNumB] = useState(0);

  useEffect(() => {
    console.log(num);
    console.log()
  }, [num]);
  return (
    <div>
      <h1>{num}</h1>
      <button onClick={()=>{setNum(num + 1)}}>Click</button>
      <h1>{numB}</h1>
      <button onClick={()=>{setNumB(numB + 1)}}>Click</button>      
    </div>
    )
}    
export default App;
